import React from 'react'

const AddTaskModal = () => {
  return (
    <form>
      <div className='form-group row'>
        <label for='taskName' className='col-sm-3 col-form-label'>Task Name: </label>
        <div className='col-sm-9'>
          <input type='text' id='taskName' className='form-control'></input>
        </div>
      </div>
      <div className='form-group row'>
        <label for='taskDescription' className='col-sm-3 col-form-label'>Description: </label>
        <div className='col-sm-9'>
          <input type='text' id='taskDescription' className='form-control'></input>
        </div>
      </div>
    </form> 
  );
}

export default AddTaskModal;
